import React from 'react';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
};

const Carousel = () => (
    <Slider {...settings}>
        <div className='w-fit' >
          <img src="/images/carousel/web_banner-5.png" alt="img1"  />
        </div>
        <div>

            <img src="/images/carousel/web_banner-5.png" alt="img3" />
        </div>
        <div>

            <img src="/images/carousel/web_banner-5.png" alt="imag2" />        </div>
        <div>

            <img src="/images/carousel/web_banner-5.png" alt="imag34" />        </div>
    </Slider>
);

export default Carousel;
